import React from 'react';
import logo from '../images/Alto_logo.png';
import kabob from '../images/Kabob_nav.png';

import { PicDiv, Logo, Kabob } from '../Styled/Picture.js';

const ImageDiv = (props) => {
    return (
        <PicDiv>
            <Logo>
                <img src={logo} alt="logo" />
            </Logo>    
            <Image>
                <img src={require('../images' + this.props.name + '.png')} alt={this.props.description} />
            </Image>
            <Kabob>
                <img src={kabob} alt="kabob" />
            </Kabob>
        </PicDiv>        
    )
}

export default ImageDiv
